import React from 'react';
import "./Profile.css";

export default function Profile(props) {
  return (
    <>
      <div className="card">
        <h1>
          {`
          // ${props.formValues.firstName} 
          ${props.formValues.lastName}
          `}
        </h1>
        <p className="title">{props.formValues.email}</p>
        <p>Harvard University</p>
      </div>
    </>
  );
}
